[[package]]
name = "botocore"
version = "1.24.0"
description = "Low-level, data-driven core of boto 3."
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
jmespath = ">=0.7.1,<1.0.0"
python-dateutil = ">=2.1,<3.0.0"
urllib3 = ">=1.25.4,<1.27"

[package.extras]
crt = ["awscrt (==0.12.5)"]

[[package]]
name = "botocore-stubs"
version = "1.24.0"
description = "Type annotations for botocore 1.24.0 generated by mypy-boto3-builder 7.0.4"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
typing-extensions = {version = "*", markers = "python_version < \"3.9\""}

[[package]]
name = "cachetools"
version = "5.0.0"
description = "Extensible memoizing collections and decorators"
category = "main"
optional = false
python-versions = "~=3.7"

[[package]]
name = "certifi"
version = "2021.10.8"
description = "Python package for providing Mozilla's CA Bundle."
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "cfn-flip"
version = "1.3.0"
description = "Convert AWS CloudFormation templates between JSON and YAML formats"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Click = "*"
PyYAML = ">=4.1"
six = "*"

[[package]]
name = "cfn-lint"
version = "0.48.3"
description = "Checks CloudFormation templates for practices and behaviour that could potentially be improved"
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"

[package.dependencies]
aws-sam-translator = ">=1.34.0"
jsonpatch = {version = "*", markers = "python_version != \"3.4\""}
